import React from "react";

const App = () => {
  return (
    <div className="full-container">
      <aside className="side-bar"></aside>
      <main>
        <section>
          <h1>Hi there, I'm</h1>
          <h2>Kushal Nandwani</h2>
          <p>Front-End Web Developer</p>
        </section>
      </main>
    </div>
  );
};

export default App;
